import { useCallback } from 'react';
import { Handle, Position } from 'reactflow';

import './UsualNode.css';

const handleStyle = (pos) => { return { top: pos } };
const handleLabelStyle = (pos) => { return { top: pos, position: 'absolute', left: 10 } };

function UsualNode({ data }) {
    const onChange = useCallback((evt) => {
        console.log(evt.target.value);
    }, []);

    let iter = 2;
    let id = 1;

    return (
        <div className="usual-node" style={{ height: data.inputs.length * 20 + 20 }}>
            {console.log(data.inputs.length)}
            <span className="node-title">{data.title}</span>
            <Handle type="target" position={Position.Right} />
            {data.inputs.map((input_name, input_type) => {
                iter += 1;
                return <>
                    <Handle type="source" key={"input" + (iter)}
                        position={Position.Left}
                        id={"input" + (iter++)}
                        style={handleStyle(iter * 10)}
                        input_type={input_type}
                    />
                    <span className="node-input" key={"input-span" + (iter)} style={handleLabelStyle(iter * 10 - 12.5)}>{input_name}</span>
                </>
            })}
        </div>
    );
}

export default UsualNode;
